import React from 'react';
import './Users.css';


let Users = (props) => {
	return <div>
		{
			props.users.map(u => <div key={u.id}>
				<span>
					<div>
						<img src={u.photoUrl} className='user-photo' />
					</div>
					<div>
						{u.followed
							? <button onClick={() => {
								props.follow(u.id)
							}}>UnFollow</button>
							: <button>Follow</button>}

					</div>
				</span>
				<span>
					<span>
						<div>{u.fullName}</div>
						<div>{u.status}</div>
					</span>
					<span>
						<div>{u.location.country}</div>
						<div>{u.location.city}</div>
					</span>
				</span>
			</div>)
		}
	</div>
}

export default Users;
